import { useEffect, useRef } from "react";
import "./profile.css";

export const Profile = () => {
  const username = useRef(null);
  useEffect(() => {
    username.current.focus();
  });
  return (
    <>
      <div className="profile-page">
        <div className="card-w-30 card-h-30 fill-primary-purple flex-col flex-col-center pd-1">
          This is the profile page!
          <input
            className="w-50 pd-05 mg-05"
            type="text"
            placeholder="Username"
            ref={username}
          />
          <input
            className="w-50 pd-05 mg-05"
            type="password"
            placeholder="Password"
          />
          <button className="w-50 pd-05 mg-05">Login</button>
        </div>
      </div>
    </>
  );
};
